The current online Holiday Campaign is a continuation of the Holiday Pop-up Shop from Bucharest, as it was only natural to share the holiday spirit with our larger community. 
After the April exhibition when for some of visitors our factory-to-consumer concept was too cumbersome compared to the traditional buy-of-the-shelf model, we didn’t know how things evolved.
The visitors and customers this time though showed us we are entering a new chapter in our story, that the customer I hoped it exists when we founded Ami Amalia is already close to us, ready to create with us and inspire us to continue our path. 
We are very down to earth when using words like success, but the conversations, the feedback we got from our customers there were worth our efforts to bring back to Bucharest our pop-up experience. 
A heartfelt thank you to everyone involved in making this possible. ❤️
